import React from "react";
import "./SearchBar.css";
import InputField from "./InputField";
function SearchBar()
{
    return(
        <div id="searchCont">
            <InputField 
                type="text"
                width="500px"
                height="6"
                fontSize="20px"
                placeholder="Search"
            />
        </div>
    );
}

export default SearchBar;
